public struct NavigoStationInfo {
    let name: String
    let group: Int
    let id: Int
    let sub: Int
    let mode: String
    let lat: Double
    let long: Double
    let found: Bool
    
    init(name: String, group: Int, id: Int, sub: Int, mode: String, lat: Double, long: Double) {
        self.name = name
        self.group = group
        self.id = id
        self.sub = sub
        self.mode = mode
        self.lat = lat
        self.long = long
        self.found = true
    }
    
    init(name: String, group: Int, id: Int, sub: Int, mode: String, lat: Double, long: Double, found: Bool) {
        self.name = name
        self.group = group
        self.id = id
        self.sub = sub
        self.mode = mode
        self.lat = lat
        self.long = long
        self.found = found
    }
}

